This main idea of this book is a principle of representation: consistency between related elements . In a system with many parts, it's often important that certain pieces be in sync with each other. For example: In an event listener, the event name (e.g. "click") must be consistent with the event parameters (e.g. mousex). In a state machine, the machine's state (e.g. FileOpen) must be consistent with the set of actions permissible on the machine (e.g. .close()). In a function with variadic arguments, the order of arguments (e.g. route("/:user/:message")) must be consistent with the order of usage (e.g. |u: User, m: Message|). Enforcing consistency is often easier in a closed system , where every piece is defined and no further ones can be added. For example, consider an (inefficient) event system with a fixed set of events: enum Event { Click { mousex: usize, mousey: usize }, KeyPress { keycode: usize }
} struct EventSystem { listeners: Vec<Box<dyn FnMut(Event) -> ()>>
} impl EventSystem { fn add_listener(&mut self, f: impl FnMut(Event) -> () + 'static) { self.listeners.push(Box::new(f)); }
} fn example() { let mut events = EventSystem { listeners: Vec::new() }; events.add_listener(|e| { if let Event::Click { mousex, mousey } = e { println!("Clicked: x={}, y={}", mousex, mousey); } });
} The nature of Rust's enum enforces that if a Click event occurred, then (and only then) will the listener be able to access the mousex field. However, what if an API client wanted to add another event to the system? They cannot reach into the API and add another enum variant. Therein lies the core technical challenge: how can an API enforce consistency between related elements in an open system? Over the next few chapters, you'll learn how careful use of Rust's type system can achieve both of these goals.
